import { getStripeKey } from '../../api/paymentAPI'

const PaymentComponent = () => {
    let [stripeKey, setStripeKey] = useState('')

    useEffect(()=> {
        getStripeKey()
        .then(data=> {
            return setStripeKey(data.stripeAPIKey)
        })
    }, [])
  return (
    <>PaymentComponent</>
  )
}

export default PaymentComponent
